import React, { Component } from "react";
import { Link } from "react-router-dom";
import '../../components/auth/Login.css'
import '../../App.css';
import logo from "../../images/r3.png";
import {
	Collapse,
	Navbar,
	NavbarToggler,
	NavbarBrand,
	Nav,
	NavItem,
	NavLink
} from 'reactstrap'
import '../../NavHeader.css'

class Landing extends Component {
  constructor(props) {
		super(props);

		this.toggle = this.toggle.bind(this);
		this.state = {
			isOpen: false
		};
	}

	toggle() {
		this.setState({
			isOpen: !this.state.isOpen
		});
	}
  render() {
    return (
      <div>
        <div className="wrapper1">

          <div className="form-wrapper">
          <Navbar color="dark" dark={true} light expand="md" style={{ marginLeft: 10, marginTop: 50 }}>
				<NavbarBrand href="/"><a class="navbar-brand" href="#"><img src={logo} style={{ width: "100px", height: "40px", marginLeft: 1400, marginTop:-70 }} /></a></NavbarBrand>
					<Nav navbar style={{ marginTop: -30 }}>

					</Nav>

			</Navbar>
            <h1>
              <b>RHYTHM</b>
            </h1>

            <br />
            <p>Welcome to Rhythm Music App demo.This websites includes "Register-Page","Login-Page"<br />
              And a Songlist to Play.</p>

          </div>
          <div className="semi-transparent-button" style={{ marginTop: "40px" }}>
            <Link
              to="/home"

            >
              Play Now
              </Link>
          </div>
          <div className="transparent_btn ">
            <Link
              to="/register"

            >
              Register
              </Link>
          </div>
          <div className="transparent_btn.blue">
            <Link
              to="/login"

            >
              Login
              </Link>
          </div>
        </div>



        <div>

        </div>
      </div>
    );
  }
}

export default Landing;
